import React from "react";
import Card from "../../UI/Card";
import "./HType.css";

const HType = (props) => {
  return (
    <Card>
      <img src={props.item.image} alt=""></img>
      <div>
        <h1>{props.item.name}</h1>
        <p>{props.item.subText}</p>
      </div>
    </Card>
  );
};

export default HType;
